  false,\n\t\"url\": null,\n\t\"notes\": \"This data series contains 24 2001 6-inch
  pachromatic digital orthoimage tiles. The data cover the City of Moscow, Idaho.
  The image data was collected using a metric digital black and white camera, 4096
  x 4096 pixel array. The data was collected concurrently with high resolution LIDAR
  data for use as a surface for ortho-rectification. The positional information was
  derived from post processed Airborne GPS, IMU and ground control to determine the
  Exterior Orientation parameters for each frame. Access is restricted to those affiliated
  with the University of Idaho. See this <a href=\"http://cloud.insideidaho.org/HelpDocs/avistaLicenseAgreement.pdf\"
  target=\"_blank\">License Agreement</a> for more information.\",\n\t\"license_title\":
